import React from "react";

const NotFound = () => {
  return (
    <div>
      <h1>404</h1>
      <img src="images/tardis.gif" alt="tardis" />
      <h3>Page not found!</h3>
      <h3>
        <strong>TRANSFORM</strong> your url to match one of the site pages
      </h3>
    </div>
  );
};

export default NotFound;
